INSERT INTO `museum` VALUES ('1', '东京国立博物馆', 'https://www.tnm.jp/', '东京国立博物馆（Tokyo National Museum）是日本最大的博物馆之一，坐落于东京都台东区上野公园内。这里收藏了大量的艺术品和文物，包括日本、中国、韩国和其他亚洲国家的珍贵文物。');
INSERT INTO `museum` VALUES ('2', '圣地亚哥艺术博物馆', 'https://collection.sdmart.org', '圣地亚哥艺术博物馆（San Diego Museum of Art）是位于美国加利福尼亚州圣地亚哥市的一座艺术博物馆，创建于1926年。该博物馆拥有来自全球各地的艺术品和文物，包括欧洲艺术、亚洲艺术、美洲艺术和当代艺术等。');
INSERT INTO `museum` VALUES ('3', '底特律艺术博物馆', 'https://dia.widen.net', '底特律艺术博物馆（Detroit Institute of Arts）是位于美国密歇根州底特律市的一座艺术博物馆，创建于1885年。该博物馆拥有来自全球各地的艺术品和文物，包括美洲艺术、欧洲艺术、非洲艺术、亚洲艺术和大洋洲艺术等。');
INSERT INTO `museum` VALUES ('4', '牛津阿希莫林艺术与考古博物館', 'https://collections.ashmolean.org', '牛津阿希莫林艺术与考古博物馆（Ashmolean Museum of Art and Archaeology）是英国牛津大学的博物馆，创建于1683年，是世界上最古老的公共博物馆之一。该博物馆收藏了大量的艺术品和考古文物，包括来自全球各地的古代文明艺术品和近现代的艺术品。');
INSERT INTO `museum` VALUES ('5', '格拉斯哥博物馆美术馆', 'http://collections.glasgowmuseums.com', '格拉斯哥博物馆美术馆（Glasgow Museums Art Gallery）是位于苏格兰格拉斯哥市中心的一座博物馆美术馆，是苏格兰最重要的艺术机构之一，也是英国最受欢迎的艺术馆之一。该馆的收藏品包括苏格兰和欧洲艺术、东方和伊斯兰艺术、现代和当代艺术、装饰艺术和设计等，同时还有世界上最大的查尔斯·雷尼·麦金托什收藏品。');
